import React from 'react';

const content = (props) => {
    return(
        <div class="column middle">
        <h2>Middle</h2>
        <span>Narendra Modi {props.name}</span><br/>
        <span>Witnessed an excellent cultural event, ‘Divya Kala Shakti’ earlier this evening. Congratulations to all those who livened the programme with great performances. This programme wonderfully showcased the talents of several Divyang artists. </span>

        <div><p>comment   retweet     like</p></div>
      </div>
    );
}


export default content
